import React from 'react';
import './App.css';
import TextField from '@mui/material/TextField';
function App() {
  return (
    <div className="App">
     <div className="Calculator">
     <TextField id="outlined-basic" label="Enter Loan Amount" variant="outlined" error={true} />
     </div>
    </div>
  );
}

export default App;
